caption:
A hard day at the office 😀. The never ending process of perfecting our craft, developing the fitness and the belief in that one day it might be possible😅
Putting in the time on “LeBlond” in Oliana the other day. This route is the final unfinished chapter of all the climbing I’ve done at this amazing wall. So cool to still be coming back to this spot after so many years and this route climbs so incredibly.

